import React from "react"
import {Redirect,Route} from "react-router-dom"
import Index from "../views/index/index"
import My from "../views/my/index"
let headerRouter = [
    {
        path:"/",
        exact:true,
        render(props){
            return <Redirect to="/index"/>
        }
    },{
        path:"/index",
        exact:true,
        render(props){
            return <Index/>
        }
    },{
        path:"/my",
        exact:true,
        render(props){
            return <My/>
        }
    },{
        path:"/download",
        exact:true,
        render(props){
            return <Download/>
        }
    }
]

export default headerRouter;
